import React from "react";
import { BrowserRouter, Route, withRouter } from "react-router-dom";
import StudentListItem from "./StudentListItem";

export class StudentList extends React.Component {
  onChange = (e) => {
    this.props.history.push(`/${e.target.value}`);
  };
  render() {
    const { items } = this.props;
    console.log(items)
    const names = items.map((item) => item.name);
    const uniquenames = [...new Set(names)];
    const listOfStudents = uniquenames
      ? uniquenames.map((uniquename) => (
          <StudentListItem
            value={uniquename}
            item={uniquename}
          ></StudentListItem>
        ))
      : "";

    return (
      <div>
        <select onChange={this.onChange}>{listOfStudents}</select>
      </div>
    );
  }
}

const Menu = withRouter(StudentList);

export function StudentRouter() {
  return (
    <BrowserRouter>
      <div className="App">
        <Route path="/first-route" render={() => <h1>Dit is de pagina van</h1>} />
        <Route path="/second-route" render={() => <h1>En dit is de pagina van</h1>} />
        <Menu />
      </div>
    </BrowserRouter>
  );
}
